import React from "react";

const GoalDetail = props => {
  return (
    <div>
      <p>{props.title}</p>
      <p>{props.description}</p>
      <p>{props.hours}</p>
      <p>{props.totalTime}</p>
    </div>
  );
};

export default GoalDetail;
